import React from "react";
import { UnitsArray } from "../units/Units";
// import Unit from "../strategy/classes/unit/Unit";
import "./CenterPart.css";
import defense from "../../src/img/18-512.png";
export const CenterPartV2: React.FC = props => {
  const renderCell = () => {
    return UnitsArray.map((unit, index) => {
      if(index == 5) return div
      return (
        <div className="row" key={index}>
          <div className="cell">
            <div className="cell__unit-info">
              <img
                onClick={() => {}}
                className="cell__unit-info__image"
                src={unit._imgPath}
                alt="img"
              />
              <div className="cell__unit-info__options">
                <div className="cell__unit-info__options__defense">
                  <button onClick={() => {}}>
                    <img src={defense} width={40} alt="img" />
                  </button>
                </div>
              </div>
            </div>
            <div className="cell__HP">
              <progress
                className="cell__HP__bar"
                value={15}
                max={unit._HP}
              ></progress>
            </div>
          </div>
        </div>
      );
    });
  };
  // const renderFeild = () => {
  //   return <div>{renderCell()}</div>;
  // };

  return <div className="centerPart">{renderCell()}</div>;
};
